import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { Form } from "react-bootstrap";

function SelfAppraisal() {
  const [inputField, setinputField] = useState([
    {
      Project: "",
      Description: "",
    },
  ]);
  const [certify, setCertify] = useState([]);
  const [noPro, setNoPro] = useState(0);
  const [noCert, setNoCert] = useState(0);
  const history = useNavigate();

  const addProject = () => {
    setinputField([
      ...inputField,
      {
        Project: "",
        Description: "",
      },
    ]);
    setNoPro(noPro + 1);
  };

  const addCert = () => {
    setCertify([
      ...certify,
      {
        Certificate: "",
        Certificate_Desc: "",
      },
    ]);
    setNoCert(noCert + 1);
  };

  return (
    <div>
      <h1>Appraisal form - self</h1>
      <Form>
        <div>
          <label htmlFor="role">Role:</label>
          <input id="role" type="text" />
        </div>
        <div>
          <label htmlFor="ach">Achievements:</label>
          <textarea id="ach" rows={5} cols={5} />
        </div>
        <div>
          <label htmlFor="oc">Other Contributions:</label>
          <textarea id="oc" rows={5} cols={5} />
        </div>
        <div>
          <div>
            {inputField.map((input, index) => (
              <div>
                <div>
                  <label htmlFor="pro">Projects:</label>
                  <input
                    id="pro"
                    type="number"
                    name={`Project_${index}`}
                    value={input.Project}
                    onChange={(e) => {
                      const updatedInputField = [...inputField];
                      updatedInputField[index].Project = e.target.value;
                      setinputField(updatedInputField);
                    }}
                  />
                </div>
                <div>
                  <label htmlFor="pro-desc">Projects Description:</label>
                  <textarea
                    id="pro-desc"
                    type="text"
                    rows={5}
                    cols={5}
                    value={input.Description}
                    name={`Description_${index}`}
                    onChange={(e) => {
                      const updatedInputField = [...inputField];
                      updatedInputField[index].Description = e.target.value;
                      setinputField(updatedInputField);
                    }}
                  />
                </div>
              </div>
            ))}
          </div>
          <button type="button" onClick={addCert}>
            Add+
          </button>
        </div>
        <div>
          <div>
            {certify.map((field, index) => {
              <div>
                <div>
                  <label htmlFor="cert">No of Certifications:</label>
                  <input
                    id="cert"
                    type="number"
                    value={field.Certificate}
                    name={`Certificate_${index}`}
                    onChange={(e) => {
                      const updatedInputField = [...certify];
                      updatedInputField[index].Certificate = e.target.value;
                      setCertify(updatedInputField);
                    }}
                  />
                </div>
                <div>
                  <label htmlFor="desc">Description of Certifications:</label>
                  <textarea
                    id="desc"
                    type="text"
                    rows={5}
                    cols={5}
                    value={field.Certificate_Desc}
                    name={`Cerification_Desc_${index}`}
                    onChange={(e) => {
                      const updatedInputField = [...certify];
                      updatedInputField[index].Certificate_Desc =
                        e.target.value;
                      setCertify(updatedInputField);
                    }}
                  />
                </div>
              </div>;
            })}
          </div>
          <button type="button" onClick={addProject}>
            Add+
          </button>
        </div>
        <div>
          <label htmlFor="skl">Skills:</label>
          <textarea id="skl" type="text" rows={5} cols={5} />
        </div>
        <div>
          <label htmlFor="rat">Self Rating:</label>
          <input type="radio" value={1} id="rat" name="1" />1
          <input type="radio" value={2} id="rat" name="2" />2
          <input type="radio" value={3} id="rat" name="3" />3
          <input type="radio" value={4} id="rat" name="4" />4
          <input type="radio" value={5} id="rat" name="5" />5
        </div>
        {/* <div>
                <label>Any Other</label>
            </div> */}
        <button type="submit">Submit</button>
      </Form>
      <button onClick={() => history("/manage")}>Manager Form </button>
    </div>
  );
}

export default SelfAppraisal;
